import React from 'react';
import ReactDom from 'react-dom';

export default function TutorialModal() {
  return ReactDom.createPortal(
    <React.Fragment>
      <div id="tutorial-modal-container"></div>
    </React.Fragment>,
    document.getElementById('portal')
  );
}
